"127867":{"id":"127867","name":"Loucos por Dinheiro","slug":"loucos-por-dinheiro","original_title":"The Brass Teapot","overview":"Alice (Juno Temple) e John (Michael Angarano) formam um casal atravessando sérias dificuldades financeiras. Mas a sorte dos dois muda quando eles descobrem um bule mágico, que gera dinheiro cada vez que eles se machucam. Agora os dois precisam decidir até onde estão dispostos a ir para enriquecer, além de manter o bule longe de outras pessoas muito interessadas neste curioso objeto.","first_air_date":"2012-09-08","runtime":100,"episode_run_time":[100],"vote_average":6.1,"created_by":["Laundry Films","Northern Lights Films"],"production_companies":[{"name":"Laundry Films"},{"name":"Northern Lights Films"}],"cast":["Juno Temple","Michael Angarano","Alexis Bledel","Billy Magnussen","Alia Shawkat"],"backdrop_path":"https://image.tmdb.org/t/p/original/tnIr0EPYySwj4bzPhU3gLjEYlX1.jpg","poster_path":"https://image.tmdb.org/t/p/original/9gzqH6EHGHXRLF5amrpPEcG77or.jpg","certification":"N/A","genres":["Comédia","Fantasia","Thriller"],"trailer":"N/A"},
"492550":{"id":"492550","name":"Normandia Nua","slug":"normandia-nua","original_title":"Normandie Nue","overview":"Em Mêle sur Sarthe, uma pequena aldeia da Normandia, os agricultores são gravemente afetados pela crise. Georges Balbuzard, o prefeito da cidade, não aceita a difícil situação e decide tentar de tudo para salvar seu povoado. Por obra do destino, Blake Newman, um grande fotógrafo conceitual, que tem por estilo deixar a multidão sem roupas para suas fotos, está passando pela região. Balbuzard vê nesse encontro a oportunidade de salvar sua aldeia, resta saber se a população estará disposta a ficar nua.","first_air_date":"2018-01-10","runtime":105,"episode_run_time":[105],"vote_average":5.6,"created_by":["Les Films des Tournelles","SND","Région Normandie","Ciné+","Canal+","France Télévisions","France 2 Cinéma","Acajou Films"],"production_companies":[{"name":"Les Films des Tournelles"},{"name":"SND"},{"name":"Région Normandie"},{"name":"Ciné+"},{"name":"Canal+"},{"name":"France Télévisions"},{"name":"France 2 Cinéma"},{"name":"Acajou Films"}],"cast":["François Cluzet","Toby Jones","François-Xavier Demaison","Arthur Dupont","Grégory Gadebois"],"backdrop_path":"https://image.tmdb.org/t/p/original/vnGvJZG5WGrsbGfrR7TVi0VY31k.jpg","poster_path":"https://image.tmdb.org/t/p/original/6NF1QGZTSNJXOUnVBIvTxIciymB.jpg","certification":"14","genres":["Drama","Comédia"],"trailer":"LsHlN4nh740"},
"25167":{"id":"25167","name":"Adeus, Amor","slug":"adeus-amor","original_title":"Bye Bye Birdie","overview":"Muitas gargalhadas e grandes canções tornaram este filme, baseado em um show de sucesso da Broadway, num dos inesquecíveis musicais de todos os tempos. Quando o astro do rock e paixão das adolescentes Conrad Birdie é recrutado, as garotas do país vão à loucura e o compositor de Conrad, Albert (Dick Van Dyke), fica desempregado. Assim, Albert e sua namorada (Janet Leigh) organizam um concurso nacional no qual uma felizarda ganhará um beijo de adeus de Conrad no programa de TV de Ed Sullivan. Kim McAfee (Ann-Margret) é a ganhadora e toda a comitiva de Conrad se dirige até a pequena cidade—para desgosto do sempre irritado pai da garota (Paul Lynde) e do ciumento namorado (o cantor Bobby Rydell) O resultado é o caos e uma série hilariante de complicações românticas.","first_air_date":"1963-04-04","runtime":112,"episode_run_time":[112],"vote_average":5.9,"created_by":["Kohlmar-Sidney Productions","Columbia Pictures"],"production_companies":[{"name":"Kohlmar-Sidney Productions"},{"name":"Columbia Pictures"}],"cast":["Janet Leigh","Dick Van Dyke","Ann-Margret","Maureen Stapleton","Bobby Rydell"],"backdrop_path":"https://image.tmdb.org/t/p/original/6RGQ7bPlJtOEw28iHDxK4MFvgDX.jpg","poster_path":"https://image.tmdb.org/t/p/original/aLoPW4ZIPUIfP0hpB3gBWZwf3kI.jpg","certification":"N/A","genres":["Comédia","Música"],"trailer":"N/A"},
"622951":{"id":"622951","name":"A Sun","slug":"a-sun","original_title":"陽光普照","overview":"A vida de uma família é completamente transformada depois da prisão do filho mais novo, A-Ho (Wu Chien-ho), que sempre foi rebelde e inconsequente, e de uma tragédia devastadora com o filho mais velho, A-Hao (Greg Han Hsu), sempre estudioso e introvertido, e que carregava o fardo de ser a esperança de um futuro respeitável.","first_air_date":"2019-11-01","runtime":156,"episode_run_time":[156],"vote_average":7.7,"created_by":["MandarinVision","Applause Entertainment","3 Ng Film"],"production_companies":[{"name":"MandarinVision"},{"name":"Applause Entertainment"},{"name":"3 Ng Film"}],"cast":["Yi-wen Chen","Samantha Shu-Chin","Chien-Ho Wu","Apple Wu","許光漢"],"backdrop_path":"https://image.tmdb.org/t/p/original/1aN3xOuSbhCU785AELdkacDB8sm.jpg","poster_path":"https://image.tmdb.org/t/p/original/dWjEkeYrmijRKwIYMVDprYG6wz8.jpg","certification":"N/A","genres":["Drama","Crime"],"trailer":"N/A"},
"2042":{"id":"2042","name":"Savior: A Última Guerra","slug":"savior-a-ultima-guerra","original_title":"Savior","overview":"Com a Guerra dos Balcãs como pano de fundo, conta a história de um mercenário radical que começa a descobrir sua verdadeira humanidade quando confrontado com as atrocidades que ocorreram durante a Guerra da Bósnia. Um mercenário endurecido na Legião Estrangeira começa a encontrar a sua própria humanidade quando confrontado com atrocidades ocorridas durante os combates na Bósnia.","first_air_date":"1998-06-01","runtime":103,"episode_run_time":[103],"vote_average":7.2,"created_by":["Initial Entertainment Group"],"production_companies":[{"name":"Initial Entertainment Group"}],"cast":["Dennis Quaid","Pascal Rollin","Catlin Foster","Stellan Skarsgård","John Maclaren"],"backdrop_path":"https://image.tmdb.org/t/p/original/iLyQVeo4Jm9UmLM8YEWStdgTuV4.jpg","poster_path":"https://image.tmdb.org/t/p/original/mggUcf8LaZFHFxUi4zdtbmjoBtf.jpg","certification":"N/A","genres":["História","Drama","Guerra"],"trailer":"N/A"},
