"34671":{"id":"34671","name":"Olga","slug":"olga","original_title":"Olga","overview":"Berlim, início do século XX. Olga Benário (Camila Morgado) é uma jovem judia alemã. Militante comunista, é perseguida pela polícia e foge para Moscou, onde recebe treinamento militar e é encarregada de acompanhar Luís Carlos Prestes (Caco Ciocler) de volta ao Brasil. Na viagem, enquanto planejam a Intentona Comunista contra o presidente Getúlio Vargas, os dois acabam apaixonando-se. Parceiros na vida e na política, Olga e Prestes terão de lutar pelo amor, pelo comunismo e, principalmente, pela sobrevivência.","first_air_date":"2004-08-20","runtime":99,"episode_run_time":[99],"vote_average":7.2,"created_by":["Globo Filmes","Lumiere","Nexus Cinema e Vídeo","Europa Filmes"],"production_companies":[{"name":"Globo Filmes"},{"name":"Lumiere"},{"name":"Nexus Cinema e Vídeo"},{"name":"Europa Filmes"}],"cast":["Camila Morgado","Caco Ciocler","Edgar Amorim","Leona Cavalli","Eliane Giardini"],"backdrop_path":"https://image.tmdb.org/t/p/original/cvi87c0MElnvslK5asTyLCmx4jL.jpg","poster_path":"https://image.tmdb.org/t/p/original/zym9l0b5eu6fDeBXJzbDuVYMOVJ.jpg","certification":"14","genres":["Drama","História","Guerra"],"trailer":"N/A"},
