"538061":{"id":"538061","name":"A Tabacaria","slug":"a-tabacaria","original_title":"Der Trafikant","overview":"Franz é um rapaz de 17 anos de idade que chega a Viena para trabalhar como aprendiz em uma tabacaria. Ali, ele conhece Sigmund Freud, um cliente frequente. Com o passar do tempo, os dois, apesar de origens muito distintas, desenvolvem uma amizade única. Quando Franz se apaixona perdidamente pela dançarina Anezka, ele busca os conselhos de seu amigo Sigmund, que, apesar de ser um renomado psicanalista, admite que o sexo feminino é um grande mistério para ele em termos românticos. A tensão política e social aumenta dramaticamente na Áustria, piorando com a chegada dos nazistas à capital. Franz, Sigmund e Anezka se perdem no meio do caos da cidade e cada um terá uma decisão difícil para tomar: ficar ou fugir de Viena?","first_air_date":"2018-10-12","runtime":109,"episode_run_time":[109],"vote_average":6.5,"created_by":["Tobis Film","Glory Film","Epo-Film","Perathon Film-und Fernsehproduktions","ORF","ARD Degeto"],"production_companies":[{"name":"Tobis Film"},{"name":"Glory Film"},{"name":"Epo-Film"},{"name":"Perathon Film-und Fernsehproduktions"},{"name":"ORF"},{"name":"ARD Degeto"}],"cast":["Simon Morzé","Bruno Ganz","Johannes Krisch","Emma Nova","Karoline Eichhorn"],"backdrop_path":"https://image.tmdb.org/t/p/original/tUfYCSqZ4efMVd84hEF5Uc2MsBO.jpg","poster_path":"https://image.tmdb.org/t/p/original/w4h717rbBuy78KgxtMKCZThWjF2.jpg","certification":"16","genres":["Drama","História"],"trailer":"kxjaGLXpq70"},
"5125":{"id":"5125","name":"O Suspeito","slug":"o-suspeito","original_title":"Rendition","overview":"Isabella está à espera do marido que está retornando aos Estados Unidos após uma conferência, mas, antes de desembarcar, Anwar El-Ibrahimi é retido por autoridades do governo e ninguém o encontra. Corrine Whitman, que investiga a morte de cidadãos americanos em um atentado terrorista, desconfia que ele esteja envolvido com um grupo perigoso no Egito, seu país natal. Anwar é levado para fora dos Estados Unidos, onde passa a ser torturado com o objetivo de revelar as informações que sabe.","first_air_date":"2007-09-07","runtime":120,"episode_run_time":[120],"vote_average":6.4,"created_by":["Anonymous Content","Level 1 Entertainment","MID Foundation"],"production_companies":[{"name":"Anonymous Content"},{"name":"Level 1 Entertainment"},{"name":"MID Foundation"}],"cast":["Reese Witherspoon","Jake Gyllenhaal","Meryl Streep","Alan Arkin","Peter Sarsgaard"],"backdrop_path":"https://image.tmdb.org/t/p/original/hVgbeqLYbbrT23pryiR0Oz009CM.jpg","poster_path":"https://image.tmdb.org/t/p/original/jCmXyCwjQAO585gKgHNCbgXiZxb.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
"17700":{"id":"17700","name":"Fundo do Mar 3D","slug":"fundo-do-mar-3d","original_title":"Deep Sea 3D","overview":"Deep Sea”: Mergulhe! Um mar de maravilhas aguarda você. O famoso diretor, Howard Hall (Into the Deep) guia você nesta aventura imersiva que mostra os anmais mais exóticos do planeta água. Johnny Depp e Kate Winslet fazem a narração. Uma coleção de estrelas está prestes a roubar cada cena. Entre elas estão: Tartarugas Verdes e os Peixes Cirurgião que tiram as algas daninhas de seus casco. Uma Lula que muda de cor 4 vezes por segundo que nem uma luz strobo, um camarão Louva-deus, que tem garras tão rápidas quanto uma bala de calibre 22, lutando com um Polvo faminto. São tantas cenas fantásticas que só assistindo pra acreditar.","first_air_date":"2006-03-03","runtime":41,"episode_run_time":[41],"vote_average":6.6,"created_by":["IMAX","Warner Bros. Pictures"],"production_companies":[{"name":"IMAX"},{"name":"Warner Bros. Pictures"}],"cast":["Kate Winslet","Johnny Depp"],"backdrop_path":"https://image.tmdb.org/t/p/original/wcrbepvPwG3mHGA1GObnj9CA2ZF.jpg","poster_path":"https://image.tmdb.org/t/p/original/oCHEwLkmPa0fTrCeDRuOko0ak6F.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
