"11323":{"id":"11323","name":"O Desinformante!","slug":"o-desinformante","original_title":"The Informant!","overview":"Mark Whitacre está em rápida ascensão na gigante da agroindústria onde trabalha. Quando descobre que a multinacional participa de um esquema de formação de cartel, decide reportar para o FBI. O executivo acredita que, com isso, será promovido e transformado em um herói da população. Mas o FBI precisa de provas, e Mark se transforma em agente infiltrado. Seus relatos, no entanto, estão sempre mudando, e torna-se impossível distinguir o que é real do que é produto de sua fértil imaginação. Baseado na história real do executivo de mais alto cargo a se tornar informante nos EUA.","first_air_date":"2009-09-18","runtime":108,"episode_run_time":[108],"vote_average":6.1,"created_by":["Warner Bros. Pictures","Participant","Groundswell Productions","Section Eight","Jaffe/Braunstein Enterprise"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Participant"},{"name":"Groundswell Productions"},{"name":"Section Eight"},{"name":"Jaffe/Braunstein Enterprise"}],"cast":["Matt Damon","Scott Bakula","Joel McHale","Melanie Lynskey","Tom Papa"],"backdrop_path":"https://image.tmdb.org/t/p/original/gDgSTQfkDG4y3SyGE2XVRBX80gy.jpg","poster_path":"https://image.tmdb.org/t/p/original/bQSXUa3V5ZwUazvYEiOvbdrZ5gn.jpg","certification":"N/A","genres":["Drama","Comédia","Crime"],"trailer":"N/A"},
