"42580":{"id":"42580","name":"Um Talento Muito Especial","slug":"um-talento-muito-especial","original_title":"Life with Mikey","overview":"Michael Chapman (Michael J. Fox) foi um ator-mirim de grande sucesso, mas quando cresceu perdeu sua popularidade. Ele agora dirige, juntamente com seu irmão Ed Chapman (Nathan Lane), uma agência em Manhattan especializada em empresariar crianças, mas os negócios não estão bons. Tentando descobrir uma criança para um comercial de biscoito, Michael encontra acidentalmente Angie Vega (Christina Vidal), uma batedora de carteira que tem apenas dez anos e uma boa resposta sempre pronta. Ele acredita que Angie possa ser sua mais nova estrela e faz de tudo para consiguir que ela faça um teste para o comercial de biscoito.","first_air_date":"1993-06-04","runtime":91,"episode_run_time":[91],"vote_average":5.7,"created_by":["Touchstone Pictures"],"production_companies":[{"name":"Touchstone Pictures"}],"cast":["Michael J. Fox","Christina Vidal","Nathan Lane","Victor Garber","David Krumholtz"],"backdrop_path":"https://image.tmdb.org/t/p/original/wvg3tUVZ4iv7xjBRlyyWyvzLshA.jpg","poster_path":"https://image.tmdb.org/t/p/original/sYSAzEIUF8T1Vc6SNLYxv6lLSgR.jpg","certification":"N/A","genres":["Comédia","Família"],"trailer":"N/A"},
