"28053":{"id":"28053","name":"Confusões em Família","slug":"confusoes-em-familia","original_title":"City Island","overview":"Toda a família tem seus segredos e a família Rizzo não fica atrás. O pai, Vince (Andy Garcia) tem um filho fora do casamento e depois de 20 anos terá que traze-lo para morar com ele. A filha, uma suposta aluna aplicada na Universidade mas, nas horas vagas vira uma stripper. Até o caçula Vinnie Jr. que aparenta ser o único \"normal\" da família esconde um grande fetiche... No fundo a família Rizzo é como qualquer outra - que atire a primeira pedra quem não tem segredos de família!","first_air_date":"2009-03-06","runtime":100,"episode_run_time":[100],"vote_average":6.9,"created_by":["Filmsmith Productions","CineSon Entertainment","Medici Entertainment","Lucky Monkey Pictures","Gremi Film Production"],"production_companies":[{"name":"Filmsmith Productions"},{"name":"CineSon Entertainment"},{"name":"Medici Entertainment"},{"name":"Lucky Monkey Pictures"},{"name":"Gremi Film Production"}],"cast":["Andy García","Julianna Margulies","Steven Strait","Emily Mortimer","Ezra Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/vy0vzHqPF4PsEip4IF4zwhKNy4P.jpg","poster_path":"https://image.tmdb.org/t/p/original/nobKb2G6yVprYkwwYS8BmQrzguA.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"13998":{"id":"13998","name":"Margot e o Casamento","slug":"margot-e-o-casamento","original_title":"Margot at the Wedding","overview":"A escritora Margot e seu filho chegam de surpresa para o casamento de sua irmã, Pauline. As irmãs entram em conflito quando Margot tenta convencer Pauline a não se casar com seu noivo.","first_air_date":"2007-11-16","runtime":93,"episode_run_time":[93],"vote_average":5.8,"created_by":["Paramount Vantage","Scott Rudin Productions"],"production_companies":[{"name":"Paramount Vantage"},{"name":"Scott Rudin Productions"}],"cast":["Nicole Kidman","Jennifer Jason Leigh","Jack Black","John Turturro","Ciarán Hinds"],"backdrop_path":"https://image.tmdb.org/t/p/original/2fjoACGt0udEgZ7dZxFj4QzD7pw.jpg","poster_path":"https://image.tmdb.org/t/p/original/xmToG09FKP7cO0jR3OQDwa5nv12.jpg","certification":"14","genres":["Comédia","Drama"],"trailer":"N/A"},
"575291":{"id":"575291","name":"A Boa Esposa","slug":"a-boa-esposa","original_title":"La Bonne Épouse","overview":"Paulette Van Der Beck e seu marido dirigem a escola de limpeza de Bitche na Alsácia há muitos anos. Sua missão é treinar adolescentes para se tornarem donas de casa perfeitas no momento em que se espera que as mulheres sejam subservientes ao marido. Após a morte repentina de seu marido, Paulette descobre que a escola está à beira da falência e tem que assumir suas responsabilidades. Mas enquanto os preparativos estão em andamento para o melhor programa de TV da competição doméstica, ela e suas animadas alunas começam a questionar suas crenças enquanto os protestos de maio de 1968 em todo o país transformam a sociedade ao seu redor.","first_air_date":"2020-03-11","runtime":108,"episode_run_time":[108],"vote_average":5.7,"created_by":["Les Films du Kiosque","France 3 Cinéma","Orange Studio","uMedia","Memento Films Production","Imagine Films"],"production_companies":[{"name":"Les Films du Kiosque"},{"name":"France 3 Cinéma"},{"name":"Orange Studio"},{"name":"uMedia"},{"name":"Memento Films Production"},{"name":"Imagine Films"}],"cast":["Juliette Binoche","Yolande Moreau","Noémie Lvovsky","Édouard Baer","François Berléand"],"backdrop_path":"https://image.tmdb.org/t/p/original/74efFx6ogyK2c1SKoI54A6PJw2n.jpg","poster_path":"https://image.tmdb.org/t/p/original/i7gOQmD98OIszcW5PmWkN9w1Nqz.jpg","certification":"14","genres":["Comédia"],"trailer":"uC13o4ezwLA"},
"483353":{"id":"483353","name":"A Hora do Lobo","slug":"a-hora-do-lobo","original_title":"The Wolf Hour","overview":"Nova Iorque, 1977. June, uma antiga figura da contra-cultura, leva uma rotina solitária no seu apartamento no sul do Bronx. Na cidade, o clima é de tensão. Uma série de crimes brutais cometidos por um assassino misterioso apelidado de Son of Sam assusta a população, que assiste receosa a escalada da violência na metrópole. A poucos dias do fatídico apagão de 1977, June assiste a tudo de sua janela, que revela a grave crise que se desenrola no mundo exterior.","first_air_date":"2019-01-26","runtime":99,"episode_run_time":[99],"vote_average":5.4,"created_by":["Bradley Pilz Productions","Automatik Entertainment","HanWay Films"],"production_companies":[{"name":"Bradley Pilz Productions"},{"name":"Automatik Entertainment"},{"name":"HanWay Films"}],"cast":["Naomi Watts","Emory Cohen","Jennifer Ehle","Kelvin Harrison, Jr.","Jeremy Bobb"],"backdrop_path":"https://image.tmdb.org/t/p/original/fVcbXwdg5Seo44PzCQJHIc6KGFr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ldWIvavK0LA15aC2vAcqj4c7FPX.jpg","certification":"N/A","genres":["Thriller"],"trailer":"N/A"},
