"310121":{"id":"310121","name":"Reaprendendo a Amar","slug":"reaprendendo-a-amar","original_title":"I'll See You in My Dreams","overview":"Após uma perda repentina, Carol (Blythe Danner), uma viúva de 70 anos, tenta encontrar um próposito para sua vida. Ela decide, então, começar a namorar de novo e se encontra envolvida com dois homens completamente diferentes: Bill (Sam Elliott), um senhor que gosta de aproveitar o presente, e Lloyd (Martin Starr), um homem mais novo que limpa a piscina dela e que também procura um sentido para sua vida. Em meio a essa situação inesperada, Carol é forçada a adotar uma nova perspectiva sobre o que significa envelhecer.","first_air_date":"2015-05-15","runtime":92,"episode_run_time":[92],"vote_average":6.3,"created_by":["Jeff Rice Films","Two Flints","Northern Lights Films"],"production_companies":[{"name":"Jeff Rice Films"},{"name":"Two Flints"},{"name":"Northern Lights Films"}],"cast":["Blythe Danner","Martin Starr","June Squibb","Rhea Perlman","Mary Kay Place"],"backdrop_path":"https://image.tmdb.org/t/p/original/giuCeJI2QjEq4HK87bRnAu5R1Fc.jpg","poster_path":"https://image.tmdb.org/t/p/original/n3igO48BrLCxmBXm8jXW8mLktSu.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
