"776527":{"id":"776527","name":"Summer of Soul (...ou, Quando a Revolução Não Pôde Ser Televisionada)","slug":"summer-of-soul-ou-quando-a-revolucao-nao-pode-ser-televisionada","original_title":"Summer of Soul (...Or, When the Revolution Could Not Be Televised)","overview":"Em 1969, no mesmo verão em que ocorreu Woodstock, outro festival musical foi organizado no Harlem, em Nova York, para celebrar a música norte-americana e a história afro-americana. As imagens do concerto Harlem Cultural Festival, filmadas há 50 anos e inéditas até hoje, capturam um empolgante momento cultural nos Estados Unidos, embora subestimado historicamente. Entrevistas com artistas que participaram do evento são intercaladas com as apresentações de, entre outros, Stevie Wonder, Mahalia Jackson e Mavis Staples, Sly & the Family Stone e Nina Simone.","first_air_date":"2021-07-02","runtime":118,"episode_run_time":[118],"vote_average":7.6,"created_by":["Mass Distraction Media","RadicalMedia","Vulcan Productions","Concordia Studio"],"production_companies":[{"name":"Mass Distraction Media"},{"name":"RadicalMedia"},{"name":"Vulcan Productions"},{"name":"Concordia Studio"}],"cast":["Stevie Wonder","Lin-Manuel Miranda","Chris Rock","Tony Lawrence","Nina Simone"],"backdrop_path":"https://image.tmdb.org/t/p/original/1LYWnmr5K3Hs3XEZ323bY0dBZsK.jpg","poster_path":"https://image.tmdb.org/t/p/original/lFO7e6lRKDMLFyU4SODcdqzHIry.jpg","certification":"N/A","genres":["Música","Documentário","História"],"trailer":"7A_A9IqC3Co"},
