"22584":{"id":"22584","name":"Uma Aventura na Martinica","slug":"uma-aventura-na-martinica","original_title":"To Have and Have Not","overview":"O capitão de um pequeno barco de aluguel da Martinica enfrenta várias complicações após ajudar um líder da Resistência Francesa e sua bela esposa a fugirem dos nazistas, em plena Segunda Guerra Mundial.\r Harry Morgan (Humphrey Bogart) e seu beberrão companheiro Eddie (Walter Brennan), são os tripulantes de um barco de aluguel na ilha da Martinica. Mas a Segunda Guerra Mundial está por todo lado atrapalhando os negócios. Quando um cliente que lhes deve uma grana alta dá o cano, eles são forçados a violar sua preferida neutralidade e a assumir um trabalho para a Resistência Francesa transportando um fugitivo dos nazistas para a Martinica. No meio disso tudo temos o relacionamento tormentoso entre Morgan e a atrevida Marie \"Slim\" Browning (Lauren Bacall), uma simpatizante da resistência e cantora no clube onde Morgan gasta a maior parte de seu dinheiro e seus dias.Filme de estreia de Lauren Bacall. (e 14 - Estimado 14 Anos)","first_air_date":"1945-01-20","runtime":100,"episode_run_time":[100],"vote_average":7.5,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Humphrey Bogart","Walter Brennan","Lauren Bacall","Dolores Moran","Hoagy Carmichael"],"backdrop_path":"https://image.tmdb.org/t/p/original/uYRnUnBE4kk5ocvyBckRfMAsZpJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/uWM38WLucbZJ7qFfZNvHVyeND4n.jpg","certification":"N/A","genres":["Aventura","Romance","Guerra"],"trailer":"N/A"},
