"140823":{"id":"140823","name":"Walt nos Bastidores de Mary Poppins","slug":"walt-nos-bastidores-de-mary-poppins","original_title":"Saving Mr. Banks","overview":"Durante 20 anos, Walt Disney tentou adquirir os direitos de Mary Poppins da escritora australiana P.L. Travers, que sempre se recusou a vendê-los para que Disney fizesse um de seus desenhos bobos. Entretanto, a crise financeira faz com que ela tenha que negociar. Desta forma, Travers viaja até os Estados Unidos e passa a trabalhar juntamente com a equipe escolhida por Walt Disney para que Mary Poppins possa chegar às telas. Minuciosa e com muita má vontade, ela começa a encontrar problemas de todo o tipo. Como o contrato lhe dá o direito de cancelar a cessão dos direitos caso não concorde com a adaptação, Disney e sua equipe precisam aceitar seus caprichos para que o filme, enfim, saia do papel.","first_air_date":"2013-11-29","runtime":125,"episode_run_time":[125],"vote_average":7.3,"created_by":["Hopscotch Features","Walt Disney Pictures","Ruby Films","Essential Media and Entertainment","BBC Film"],"production_companies":[{"name":"Hopscotch Features"},{"name":"Walt Disney Pictures"},{"name":"Ruby Films"},{"name":"Essential Media and Entertainment"},{"name":"BBC Film"}],"cast":["Emma Thompson","Tom Hanks","Colin Farrell","Paul Giamatti","Ruth Wilson"],"backdrop_path":"https://image.tmdb.org/t/p/original/o1MstLw9ARhWdBPDZMDlaRgK3is.jpg","poster_path":"https://image.tmdb.org/t/p/original/7sjEjyYeOsrM1Iri2u5j43bVJMf.jpg","certification":"10","genres":["Comédia","Drama","História"],"trailer":"9L6UI5UsgpE"},
