"2587":{"id":"2587","name":"Irmão Sol, Irmã Lua","slug":"irmao-sol-irma-lua","original_title":"Fratello sole, sorella luna","overview":"A trajetória da vida de São Francisco de Assis (Graham Faulkner), que quando jovem era filho de comerciantes ricos e desfrutava de vinho, mulheres e canções sem ter nenhuma preocupação. Quando a guerra e a doença assolam a região onde vive, ele sofre uma grande transformação. Ao aparecer diante do bispo local e tirar suas roupas renuncia sua vida prévia para se dedicar a Deus. Mas sua pregação só iria chegar ao ápice ao ir para Roma, para ter uma audiência com o papa Inocêncio III (Alec Guinness).","first_air_date":"1972-03-03","runtime":121,"episode_run_time":[121],"vote_average":7.0,"created_by":["Euro International Films","Vic Films Productions","Paramount Pictures"],"production_companies":[{"name":"Euro International Films"},{"name":"Vic Films Productions"},{"name":"Paramount Pictures"}],"cast":["Graham Faulkner","Judi Bowker","Leigh Lawson","Kenneth Cranham","Lee Montague"],"backdrop_path":"https://image.tmdb.org/t/p/original/s3h57HUNewjGiX2kCXaTzg5DAXr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ckce80A0JOFC1DNfmwnZ2SDwhkL.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
