"508802":{"id":"508802","name":"Pinguins","slug":"pinguins","original_title":"Penguins","overview":"O novo filme da Disneynature “Pinguins” é uma história de amadurecimento sobre um pinguim Adélie chamado Steve que se junta a milhões de machos na primavera gelada da Antártida em busca de um ninho adequado, encontra um parceiro de vida e inicia uma família. Nada disso é fácil para ele, especialmente considerando que ele é alvo de tudo, de baleias assassinas a focas leopardo, que sem piedade ameaçam sua felicidade. Da equipe de filmagem por trás de \"Ursos\" e \"Chimpanzé\", os \"Pinguins\", da Disneynature, estreiam nos cinemas em todo os Estados Unidos no Dia da Terra de 2019.","first_air_date":"2019-04-17","runtime":76,"episode_run_time":[76],"vote_average":7.0,"created_by":["Disneynature","Film Victoria"],"production_companies":[{"name":"Disneynature"},{"name":"Film Victoria"}],"cast":["Ed Helms"],"backdrop_path":"https://image.tmdb.org/t/p/original/9c1rYqUGEgee9xGNGiafiX341cN.jpg","poster_path":"https://image.tmdb.org/t/p/original/dus2lsoHvANyEiTYnQzFiJAye4l.jpg","certification":"L","genres":["Documentário","Família"],"trailer":"N/A"},
"346650":{"id":"346650","name":"Dia da Namorada","slug":"dia-da-namorada","original_title":"Girlfriend's Day","overview":"Já parou pra pensar quem escreveu aquelas palavras perfeitas do cartão de Dia das Mães que você enviou no ano passado? Ou aquele cartão de aniversário hilário que você deu ao seu melhor amigo? Um mestre das palavras, isso sim!\r No filme original Netflix Dia da Namorada, o diretor Michael Paul Stephenson (The American Scream) retrata uma história excêntrica e inteligente sobre amor e perda, e também sobre o pior lugar para sofrer um corte de papel! Conheça Ray Wentworth (Bob Odenkirk), um grande escritor que acaba se tornando um mero criador de cartões comemorativos. Tentando recuperar os sentimentos que um dia lhe trouxeram a glória, ele acaba se envolvendo em uma teia de traição e assassinato em meio a escritores que buscam as palavras perfeitas para uma nova data comemorativa: o Dia da Namorada.","first_air_date":"2017-01-24","runtime":70,"episode_run_time":[70],"vote_average":5.0,"created_by":["Odenkirk Provissiero Entertainment"],"production_companies":[{"name":"Odenkirk Provissiero Entertainment"}],"cast":["Bob Odenkirk","Amber Tamblyn","Stacy Keach","Alex Karpovsky","Kevin O'Grady"],"backdrop_path":"https://image.tmdb.org/t/p/original/Lxee36cGzUgzthpDar2yinQgKN.jpg","poster_path":"https://image.tmdb.org/t/p/original/6D47RMFdPVVEzZPmiSbyH9R2iTV.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
