"99367":{"id":"99367","name":"Saindo do Armário","slug":"saindo-do-armario","original_title":"Date and Switch","overview":"Michael e Matty são amigos de há muito com algo em comum: nunca perderam a virgindade. Os dois decidem que a noite do baile de formatura será a data limite para terem sexo pela primeira vez. Entretanto Matty assume a sua homossexualidade surpreendendo Michael que se mantém aberto e interessado em conhecer mais sobre a cultura gay. Antes do baile, Michael começa a sair com a ex-namorada de Matty.","first_air_date":"2014-02-14","runtime":91,"episode_run_time":[91],"vote_average":5.8,"created_by":["Dude Productions","Laurence Mark Productions"],"production_companies":[{"name":"Dude Productions"},{"name":"Laurence Mark Productions"}],"cast":["Nicholas Braun","Hunter Cope","Dakota Johnson","Zach Cregger","Nick Offerman"],"backdrop_path":"https://image.tmdb.org/t/p/original/fgqVn06PbICsnfhXXurHxtqaP86.jpg","poster_path":"https://image.tmdb.org/t/p/original/j7oQf2xVK7ards5RLgtfWm3Mz0b.jpg","certification":"16","genres":["Comédia"],"trailer":"N/A"},
