"597856":{"id":"597856","name":"Criaturas ao Ataque","slug":"criaturas-ao-ataque","original_title":"Critters Attack!","overview":"Inspirado pela famosa série de filmes dos anos 80 e 90, Criaturas ao Ataque acompanhe Drea, uma jovem de 20 anos que aceita, relutantemente, trabalhar como babá para um professor da faculdade em que pretende ingressar. Com dificuldade para manter entretidos os filhos do professor, Trissy e Jake, e seu próprio irmãozinho, Phillip, Drea resolve levá-los a um passeio, sem saber que misteriosas criaturas alienígenas caíram do céu e começaram a devorar tudo o que encontram. Enquanto são perseguidas pelas criaturas vorazes, Drea e as crianças encontram uma adorável, e aparentemente inofensiva, criatura chamada Bianca, uma princesa exilada em fuga. Conforme as criaturas começam a se dirigir ao campus, Drea e as crianças, que agora estão intimamente ligadas à Bianca, tentam interceptá-las. Será que Drea encontrará coragem dentro de si? E seria isso o suficiente para deter o ataque das criaturas? E será que a princesa é tão inocente quanto parece?","first_air_date":"2020-11-06","runtime":89,"episode_run_time":[89],"vote_average":6.3,"created_by":["Blue Ribbon Content","Triton Media Holdings Incorporated","New Line Cinema"],"production_companies":[{"name":"Blue Ribbon Content"},{"name":"Triton Media Holdings Incorporated"},{"name":"New Line Cinema"}],"cast":["Tashiana Washington","Ava Preston","Jack Fulton","Jaeden Noel","Dee Wallace"],"backdrop_path":"https://image.tmdb.org/t/p/original/32HqRM2XTccuEpYuERTSLnbAeBZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/46FOJVvrOhq04WWZX35m4DYpSWb.jpg","certification":"14","genres":["Comédia","Terror","Ficção científica","Cinema TV"],"trailer":"N/A"},
