"2625":{"id":"2625","name":"Mr. Jones","slug":"mr-jones","original_title":"Mr. Jones","overview":"O impulsivo, irresponsável, irresistível Mr. Jones (Richard Gere) é um homem que conquista as pessoas sem esforço com seu charme contagioso e energia fascinante. Ele também é um homem que facilmente entra em depressão e desespero. A inteligente, dedicada e respeitada Dra. Libbie Bowen (Lena Olin) é a psiquiatra que, apesar de toda a experiência, está totalmente despreparada para tratar o Mr. Jones. Ele a desafia, a intriga, consegue ver o que ela sente por dentro, e logo Libbie se vê arriscando toda sua carreira por amor. Em uma história atípica do poder do amor, Mr. Jones esclarece as enormes complexidades da psicose maníaco-depressiva enquanto examina a frágil relação médico/paciente no difícil mundo da saúde mental.","first_air_date":"1993-10-08","runtime":114,"episode_run_time":[114],"vote_average":5.8,"created_by":["TriStar Pictures"],"production_companies":[{"name":"TriStar Pictures"}],"cast":["Richard Gere","Lena Olin","Anne Bancroft","Tom Irwin","Delroy Lindo"],"backdrop_path":"https://image.tmdb.org/t/p/original/cvtHD8gxuHyLtF6M8ZN2QPWxOYr.jpg","poster_path":"https://image.tmdb.org/t/p/original/rmAnfar51B0qSQ1Wkix0iKtUUnx.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"186161":{"id":"186161","name":"A Gaiola Dourada","slug":"a-gaiola-dourada","original_title":"La Cage Dorée","overview":"Maria e José Ribeiro são um casal de portugueses emigrados em França há mais de três décadas. Ela sempre trabalhou como porteira de um prédio num dos melhores bairros parisienses e ele na construção civil. Todos gostam deles, quer pela sua simpatia e humildade, quer pela sua incansável boa vontade para ajudar quem precisa. Quando recebem a notícia de uma herança em Portugal que lhes concretiza o velho sonho do regresso às raízes, tudo parece perfeito. Porém, a verdade é que ninguém está muito interessado em perder a sua amizade e, subtilmente, uns e outros começam a organizar-se de maneira a fazê-los mudar de ideias.","first_air_date":"2013-04-19","runtime":87,"episode_run_time":[87],"vote_average":6.7,"created_by":["Zazi Films","Pathé Productions","TF1 Films Production"],"production_companies":[{"name":"Zazi Films"},{"name":"Pathé Productions"},{"name":"TF1 Films Production"}],"cast":["Rita Blanco","Joaquim de Almeida","Roland Giraud","Chantal Lauby","Barbara Cabrita"],"backdrop_path":"https://image.tmdb.org/t/p/original/lpZpXLTdcuqZc9tEVU13xHm0BTL.jpg","poster_path":"https://image.tmdb.org/t/p/original/hGKUWIavtkfVkM2dNZMZZDdU0sj.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
