"84355":{"id":"84355","name":"A Irmã da Sua Irmã","slug":"a-irma-da-sua-irma","original_title":"Your Sister's Sister","overview":"Já faz um ano que o irmão de Jack morreu, mas ele ainda não consegue superar o fato. Iris, sua melhor amiga, propõe que ele passe uma semana sozinho na cabana isolada de seu pai. Mas ao chegar no local, ele encontra Hannah, irmã de Iris, que também decidiu se isolar para superar seus traumas: ela acaba de terminar uma relação de sete anos. À medida em que os dois começam a se conhecer, Iris chega na cabana, com uma série de revelações inesperadas aos dois.","first_air_date":"2011-09-11","runtime":90,"episode_run_time":[90],"vote_average":6.5,"created_by":["Ada Films"],"production_companies":[{"name":"Ada Films"}],"cast":["Emily Blunt","Rosemarie DeWitt","Mark Duplass","Michael Harring","Mike Birbiglia"],"backdrop_path":"https://image.tmdb.org/t/p/original/lW6mVGxqDjVaqcVJJbRnrXe8vsq.jpg","poster_path":"https://image.tmdb.org/t/p/original/yEyoOzOEUBMSofsTticDWBOOsv7.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
