"1596":{"id":"1596","name":"População 436","slug":"populacao-436","original_title":"Population 436","overview":"Curiosa trama de suspense que envolve muito mais coisas do que é sugerido. Uma pequena cidade norte-americana parece ser perfeita. Sua população está sempre feliz e os problemas nunca aparecem. Em Rockwell Falls, a vida encontrou o paraíso na Terra. Porém, quando um investigador federal é enviado ao lugar, ele descobre que o número da população não teve nenhuma alteração nos últimos cem anos, e aos poucos vai descobrindo os terríveis segredos que estão por traz dessa estagnação e da aparente perfeição da cidade. Quando menos espera, ele é envolvido em uma perigosa trama doentia em uma rede de fanatismo religioso e tradição puritana. Agora, preso nesse pesadelo, ele precisa encontrar uma forma de sair do local com vida.","first_air_date":"2006-07-04","runtime":88,"episode_run_time":[88],"vote_average":5.8,"created_by":["Pariah"],"production_companies":[{"name":"Pariah"}],"cast":["Jeremy Sisto","Charlotte Sullivan","Fred Durst","Peter Outerbridge","R.H. Thomson"],"backdrop_path":"https://image.tmdb.org/t/p/original/fXa1d8Jkzx4UXKUmk8hpMrc42cq.jpg","poster_path":"https://image.tmdb.org/t/p/original/jmmKiSSJkR3PEgQmoTnoujDHyHJ.jpg","certification":"16","genres":["Terror","Thriller"],"trailer":"N/A"},
