"94352":{"id":"94352","name":"Cirque du Soleil: Outros Mundos","slug":"cirque-du-soleil-outros-mundos","original_title":"Cirque du Soleil: Worlds Away","overview":"O mais famoso circo acrobático do mundo traz Worlds Away, um espetáculo inédito concebido especialmente para um filme em 3D. A trama apresenta Mia, uma jovem garota que decide visitar o circo. Chegando no local, ela observa um jovem arrumar a tenda do picadeiro, e os dois se apaixonam à primeira vista. Ela logo descobre que este homem é um famoso equilibrista e trapezista, e decide assistir a uma de suas apresentações. No entanto, quando o artista percebe a presença de Mia no público, ele erra sua manobra e cai em um mundo mágico, levando Mia consigo. Entre diversos perigos e seres mágicos, eles tentam se encontrar.","first_air_date":"2012-11-09","runtime":97,"episode_run_time":[97],"vote_average":7.0,"created_by":["Reel FX Creative Studios"],"production_companies":[{"name":"Reel FX Creative Studios"}],"cast":["Erica Linz","Igor Zaripov","Matt Gillanders","Jason Berrent","Dallas Barnett"],"backdrop_path":"https://image.tmdb.org/t/p/original/22RJPOcck5lnLDiLKy0kjqtgH15.jpg","poster_path":"https://image.tmdb.org/t/p/original/fIyOrVzesRYxadeJjo9LUTFuMdp.jpg","certification":"L","genres":["Fantasia","Família","Música","Drama","Romance"],"trailer":"N/A"},
