"509364":{"id":"509364","name":"Graças a Deus","slug":"gracas-a-deus","original_title":"Grâce à Dieu","overview":"Um dia, Alexandre toma coragem para escrever uma carta à Igreja Católica, revelando um segredo: quando criança, foi abusado sexualmente pelo padre Preynat. Os psicólogos da Igreja tentam ajudar mas não conseguem ocultar o fato de que o criminoso jamais foi afastado do cargo, pelo contrário: continua atuando junto à crianças. Alexandre toma coragem e publica sua carta, o que logo faz aparecerem muitas outras denúncias do mesmo padre, além da conivência do cardeal Barbarin, que nunca tomou providências. Juntos, Alexandre, François e Emmanuel criam um grupo de apoio para aumentar a pressão na justiça por providências. Mas eles terão que enfrentar todo o poder da cúpula da Igreja.","first_air_date":"2019-02-20","runtime":137,"episode_run_time":[137],"vote_average":7.2,"created_by":["Mandarin Films Productions Ltd.","SCOPE Pictures"],"production_companies":[{"name":"Mandarin Films Productions Ltd."},{"name":"SCOPE Pictures"}],"cast":["Melvil Poupaud","Denis Ménochet","Swann Arlaud","Éric Caravaca","François Marthouret"],"backdrop_path":"https://image.tmdb.org/t/p/original/lBgIZ6SkDOz95aex524hVRkTaEM.jpg","poster_path":"https://image.tmdb.org/t/p/original/pGON91viglFuiug8BIue0JADxI7.jpg","certification":"N/A","genres":["Drama"],"trailer":"j7xBr8VTcRM"},
