"10359":{"id":"10359","name":"Ressurreição - Retalhos de Um Crime","slug":"ressurreicao-retalhos-de-um-crime","original_title":"Resurrection","overview":"Em Chicago um serial killer é conhecido por levar a parte do corpo de suas vítimas, e deixá-las sangrar até a morte. Ele também escreve números nos corpos e, assim, é chamado de \"Assassino Dos Números\". Quem está investigando o caso é o detetive John Prudhomme (Christopher Lambert), que acaba descobrindo que o assassino está juntando os pedaços das vítimas para montar \"Jesus Cristo\", e que em cada sexta-feira ele terá mais uma vítima, para tudo ficar pronto na Páscoa. Três mortes já aconteceram e Prudhomme tem de correr contra o tempo pra que não haja mais nenhuma vítima.","first_air_date":"1999-06-05","runtime":108,"episode_run_time":[108],"vote_average":6.2,"created_by":["Baldwin/Cohen Productions","Interlight"],"production_companies":[{"name":"Baldwin/Cohen Productions"},{"name":"Interlight"}],"cast":["Christopher Lambert","Leland Orser","Barbara Tyson","Jeff J.J. Authors","David Cronenberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/deqB89VLPy9WJzGrb51tU1DyuhN.jpg","poster_path":"https://image.tmdb.org/t/p/original/5JdRH9xymK7pzE5ODIVqwp7lvoF.jpg","certification":"N/A","genres":["Crime","Mistério","Terror"],"trailer":"N/A"},
"251321":{"id":"251321","name":"Marcas do Passado","slug":"marcas-do-passado","original_title":"Aloft","overview":"Ao acompanhar a história de uma mãe e seu filho, nós nos aprofundamos num passado afetado por um acidente que os destroçou. Ela vai se tornar uma artista e terapeuta famosa, e ele vai encontrar seu eixo como um falcoeiro peculiar, que carrega as marcas do abandono. No presente, uma jovem jornalista vai ocasionar um encontro entre os dois, o que faz questionar o sentido da vida e da arte, para podermos contemplar a possibilidade de viver a vida plenamente, apesar das incertezas do caminho.","first_air_date":"2014-02-12","runtime":97,"episode_run_time":[97],"vote_average":5.5,"created_by":["Buffalo Gal Pictures","Wanda Visión","Arcadia Motion Pictures"],"production_companies":[{"name":"Buffalo Gal Pictures"},{"name":"Wanda Visión"},{"name":"Arcadia Motion Pictures"}],"cast":["Jennifer Connelly","Cillian Murphy","Mélanie Laurent","William Shimell","Zen McGrath"],"backdrop_path":"https://image.tmdb.org/t/p/original/61DzNcUduoqVDooSEhOHvkXOI7L.jpg","poster_path":"https://image.tmdb.org/t/p/original/b2wek7dU0Wm5Qy20P6shvaEJdoN.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
