"2160":{"id":"2160","name":"Viagem ao Fundo do Mar","slug":"viagem-ao-fundo-do-mar","original_title":"Voyage to the Bottom of the Sea","overview":"Uma expedição científica de rotina ao Pólo Norte transforma-se em uma corrida para salvar a vida na Terra, quando um cinturão de radiação no espaço se inflama e começa a aquecer o planeta de maneira incontrolável. O Almirante Nelson e a tripulação do submarino atômico Seaview enfrentam sabotadores, criaturas marinhas gigantescas e ataques de outros submarinos durante sua corrida para evitar a catástrofe global.","first_air_date":"1961-07-12","runtime":105,"episode_run_time":[105],"vote_average":5.7,"created_by":["Windsor Productions","20th Century Fox"],"production_companies":[{"name":"Windsor Productions"},{"name":"20th Century Fox"}],"cast":["Walter Pidgeon","Robert Sterling","Barbara Eden","Peter Lorre","Joan Fontaine"],"backdrop_path":"https://image.tmdb.org/t/p/original/wrafPAcHnOyWeJLf43yuaFp28Dw.jpg","poster_path":"https://image.tmdb.org/t/p/original/vKFGZtvMsUdWQZ4pDsVIFLkiHDA.jpg","certification":"N/A","genres":["Aventura","Drama","Ficção científica"],"trailer":"N/A"},
