"59990":{"id":"59990","name":"O Pagador de Promessas","slug":"o-pagador-de-promessas","original_title":"O Pagador de Promessas","overview":"Zé do Burro e sua esposa Rosa vivem em uma pequena propriedade rural próxima de Salvador. Um dia, o burro de estimação de Zé é atingido por um raio e ele acaba indo a um terreiro de candomblé, onde faz uma promessa para salvar o animal. Com o restabelecimento do bicho, Zé põe-se a cumprir a promessa e doa metade de seu sítio, para depois começar uma caminhada rumo a Salvador, carregando nas costas uma imensa cruz de madeira. Mas a via crucis de Zé ainda se torna mais angustiante ao ver Rosa se envolver com o cafetão Bonitão e ao ser impedido por Padre Olavo de entrar em sua igreja, pela razão de Zé ter feito sua promessa em um terreiro.","first_air_date":"1962-04-17","runtime":92,"episode_run_time":[92],"vote_average":8.1,"created_by":["Cinedistri"],"production_companies":[{"name":"Cinedistri"}],"cast":["Leonardo Villar","Glória Menezes","Dionísio Azevedo","Geraldo del Rey","Roberto Ferreira"],"backdrop_path":"https://image.tmdb.org/t/p/original/k13mFZr51lcOxvLrHHCk9Llevcf.jpg","poster_path":"https://image.tmdb.org/t/p/original/udIwjCpsorFKdn1XHJgV1Zc7Joe.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
