"201749":{"id":"201749","name":"O Último Amor do Sr. Morgan","slug":"o-ultimo-amor-do-sr-morgan","original_title":"Mr. Morgan's Last Love","overview":"Por mais que more em Paris há bastante tempo, Matthew Morgan (Michael Caine) não conhece a língua local. Muito graças à sua esposa, Joan (Jane Alexander), que sempre foi sua intérprete pelas ruas da capital francesa. Entretanto, Joan faleceu há três anos e, desde então, Matthew vive triste e solitário, ocupando seu tempo com aulas de inglês ocasionais. Um dia, ele é ajudado no ônibus por Pauline (Clémence Poésy), uma simpática professora de dança. Não demora muito para que eles se tornem amigos, já que ela lembra a esposa de Matthew e ele lembra o pai de Pauline. Entretanto, tudo muda quando a tristeza fala mais alto e Matthew tenta o suicídio.","first_air_date":"2013-08-22","runtime":116,"episode_run_time":[116],"vote_average":6.7,"created_by":["Bavaria Pictures","Senator Film"],"production_companies":[{"name":"Bavaria Pictures"},{"name":"Senator Film"}],"cast":["Michael Caine","Clémence Poésy","Gillian Anderson","Justin Kirk","Jane Alexander"],"backdrop_path":"https://image.tmdb.org/t/p/original/94NOogxgor0pIM0kgiEVZyurjHq.jpg","poster_path":"https://image.tmdb.org/t/p/original/AgMWuCitF55f8srh5yMFfcPZM20.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"14195":{"id":"14195","name":"Cecil Bem Demente","slug":"cecil-bem-demente","original_title":"Cecil B. Demented","overview":"Cecil B. Demente (Stephen Dorff) é o líder de um grupo de cineastas terroristas que tem como meta principal em sua vida se vingar dos estragos provocados pelo cinema comercial de Hollywood. Para isso, decide sequestrar Honey Whitlock (Melanie Griffith), a mais popular estrela do cinema americano, que estava se dirigindo para a pré-estréia de seu mais novo filme arrasa-quarteirão. Com Whitlock em seu poder, Demente e sua gangue logo preparam a produção de um filme underground, em que forçam a famosa atriz a estrelar. Armados com luzes, câmeras e muita coragem, Demente e sua trupe se preparam agora para filmar em Baltimore, onde pretendem invadir os sets de filmagem de uma badalada sequência.","first_air_date":"2000-08-02","runtime":87,"episode_run_time":[87],"vote_average":6.4,"created_by":["Polar Entertainment","Le Studio Canal+"],"production_companies":[{"name":"Polar Entertainment"},{"name":"Le Studio Canal+"}],"cast":["Melanie Griffith","Stephen Dorff","Alicia Witt","Adrian Grenier","Maggie Gyllenhaal"],"backdrop_path":"https://image.tmdb.org/t/p/original/rCz0Dqhf5agF82Na4grN3SqpmRo.jpg","poster_path":"https://image.tmdb.org/t/p/original/jYctQxBUEUaE708mV7bSjl9tQeR.jpg","certification":"N/A","genres":["Crime","Comédia","Ação"],"trailer":"N/A"},
