"20721":{"id":"20721","name":"Código do Silêncio","slug":"codigo-do-silencio","original_title":"Code of Silence","overview":"Eddie Cusack é um detective de Chicago que trabalha pelas suas próprias regras - um hábito perigoso, especialmente quando quebra o pacto do Código de Silêncio para desmascarar uma mortífera e encoberta operação policial. Agora um proscrito, ele não recebe qualquer ajuda dos seus colegas desconfiados quando se vê metido numa batalha contra dois reis do crime rivais. Mas Cusack é um só exército e não teme ninguém, declarou guerra aos criminosos e conta com toda a sua perícia, rapídissimos golpes de karaté e uma surpresa especial: Prowler, um tanque telecomandado e equipado com mísseis.","first_air_date":"1985-05-03","runtime":101,"episode_run_time":[101],"vote_average":5.9,"created_by":["Raymond Wagner Productions","Orion Pictures"],"production_companies":[{"name":"Raymond Wagner Productions"},{"name":"Orion Pictures"}],"cast":["Chuck Norris","Mike Genovese","Henry Silva","Bert Remsen","Ralph Foody"],"backdrop_path":"https://image.tmdb.org/t/p/original/zez0Lqc4wqLb4toNOB3M6IjRAe7.jpg","poster_path":"https://image.tmdb.org/t/p/original/mApKqQdT2t0pOnZOQTuMf7w0nQS.jpg","certification":"N/A","genres":["Ação","Crime","Drama","Thriller"],"trailer":"N/A"},
