"25430":{"id":"25430","name":"A Grande Ilusão","slug":"a-grande-ilusao","original_title":"All the King's Men","overview":"O filme conta a história de ascensão e queda de um político rebelde do interior que começa exigindo reformas e justiça social, mas acaba embriagado pelo próprio poder. O roteiro é uma adaptação do romance de Robert Penn Warren, publicado em 1946, e pelo qual o autor recebeu o Prémio Pulitzer de Literatura.","first_air_date":"1949-11-16","runtime":110,"episode_run_time":[110],"vote_average":7.0,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["John Ireland","Broderick Crawford","Joanne Dru","John Derek","Mercedes McCambridge"],"backdrop_path":"https://image.tmdb.org/t/p/original/bSTvvll9gIOcoavWRIVYL5RoTkn.jpg","poster_path":"https://image.tmdb.org/t/p/original/cN6OJA6xGmxHzkO59QJpspujAwg.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
